import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http'

@Injectable({
  providedIn: 'root'
})
export class AuthService {
  constructor(private httpClient: HttpClient) { }
  url: string = 'http://localhost:3000/auth';
  signup() {
    return this.httpClient.post(this.url + '/signup', null);
  }
  signin() {
    console.log('signin called in authService');
    let result;
    this.httpClient.post(this.url + '/signin', null)
      .subscribe((postResult) => result = postResult);
    return result;
  }
}
